%spark

import org.apache.commons.io.IOUtils
import java.net.URL
import java.nio.charset.Charset
import java.text.SimpleDateFormat
import java.util.Calendar
import java.sql.Date
import java.sql.Timestamp

var PZAP_ID=z.input("Batch_ID", "CLMU")
val reportPath="file:///C:/Users/224597/Documents/CLAIMS/"
println("""%html <b> Batch Overall performace graph """)
//UDF
object FileName extends Serializable{
def Report: String = {
    reportPath.concat("test_batch_details.csv")
  }
def getTimestamp(x:Any) : Timestamp = {
    val format = new SimpleDateFormat("yyyy-MM-dd' 'HH:mm:ss")
    if (x.toString() == "") 
    return null
    else {
        val d = format.parse(x.toString());
        val t = new Timestamp(d.getTime());
        return t
    }
}
def getDate(x:Any) : Date = {
    val format = new SimpleDateFormat("yyyy-MM-dd")
    if (x.toString() == "") 
    return null
    else {
        val d = format.parse(x.toString());
        return new java.sql.Date(d.getTime())
    }
}
def getMonth(x:Any) : String = {
    val format = new SimpleDateFormat("yyyy-MM-dd")
    if (x.toString() == "") 
    return null
    else {
        val d = format.parse(x.toString())
        val i=d.getMonth
        val month = i match {
            case 0  => "January"
            case 1  => "February"
            case 2  => "March"
            case 3  => "April"
            case 4 => "May"
            case 5  => "June"
            case 6  => "July"
            case 7   => "August"
            case 8  => "September"
            case 9 => "October"
            case 10 => "November"
            case 11 => "December"
            case _  => "Invalid month"  // the default, catch-all
        }
    return month.toString()
    }
}
}
var Start_Date=FileName.getTimestamp(z.input("Batch start date", "2018-01-01 00:00:00"))
var End_Date=FileName.getTimestamp(z.input("Batch end date", "2019-01-01 00:00:00"))
println(FileName.getMonth(Start_Date))
val batch = sc.parallelize(IOUtils.toString(new URL(FileName.Report),Charset.forName("utf8")).split("\n"))
case class Batch(PZPZ_ID:String,
PZAP_PARENT_APP_ID:String ,
PZAP_APP_ID:String,	
SYIN_STS:String,	
SYIN_GPARENT_INST:String,	
SYIN_PARENT_INST:String,	
SYIN_INST:String,	
SYIN_CREATE_DTM:java.sql.Timestamp ,
SYIN_COMPLETE_DTM:java.sql.Timestamp,
SYBI_JOB_NAME:String,	
SYBI_JOB_DESC:String,	
JOB_TYPE:String,	
JOB_RUN_DATE:java.sql.Date, 	
JOB_TOT_ENGINES:String,	
JOB_RUN_TIME:String ,	
JOB_EXIT_CODE:String,	
JOB_LOG_NAME:String,
JOB_MONTH:String)

val batch_details = batch.map(s=>s.split(",")).filter(s=>s(0)!="\"COUNT_OF_CLAIMS\"").map(
    s=>Batch(
        s(0).replaceAll("\"", ""), //PZPZ_ID
        s(1).replaceAll("\"", ""),//PZAP_PARENT_APP_ID
        s(2).replaceAll("\"", ""),//PZAP_APP_ID
        s(3).replaceAll("\"", ""),//SYIN_STS
        s(4).replaceAll("\"", ""),//SYIN_GPARENT_INST
        s(5).replaceAll("\"", ""),//SYIN_PARENT_INST
        s(6).replaceAll("\"", ""),//SYIN_INST
        FileName.getTimestamp(s(7)),//SYIN_CREATE_DTM
        FileName.getTimestamp(s(8)),//SYIN_COMPLETE_DTM
        s(9).replaceAll("\"", ""),//SYBI_JOB_NAME
        s(10).replaceAll("\"", ""),//SYBI_JOB_DESC
        s(11).replaceAll("\"", ""),//JOB_TYPE
        FileName.getDate(s(12)),//JOB_RUN_DATE
        s(13).replaceAll("\"", ""),//JOB_TOT_ENGINES
        s(14).replaceAll("\"", ""),//JOB_RUN_TIME
        s(15).replaceAll("\"", ""),//JOB_EXIT_CODE
        s(16).replaceAll("\"", ""),//JOB_LOG_NAME
        FileName.getMonth(s(12)).replaceAll("\"", "")//JOB_MONTH
        )
)
batch_details.toDF().registerTempTable("batch")
//batch_details.toDF().printSchema()
var result= batch_details.toDF().sqlContext.sql(s"SELECT *,(JOB_RUN_TIME/60) as JOB_TIME_MIN FROM batch where SYIN_CREATE_DTM >= '$Start_Date' and SYIN_CREATE_DTM <= '$End_Date' AND PZAP_APP_ID in($PZAP_ID) order by JOB_RUN_DATE")

z.show(result)

